def retry_POOL_resp(url, retry=3):
    try:
        if retry <= 0:
            raise Exception
        response = requests.get(url, timeout=20)
        result = json.loads(response.text)
        ip = result['ip']
        port = result['port']
        user = result['user']
        password = result['password']
        protocal = result['protocol'][0]
        real_proxy = protocal + '://' + ip + ':' + port
        return real_proxy
    except Exception as e:
        if retry > 0:
            return retry_POOL_resp(url, retry-1)


def set_of_pre(file_name, keyword, cut_threshold, index):
    companies_li = list()
    d = dawg.CompletionDAWG()
    d.load(file_name)
    companies = d.keys(keyword)
    pre_dict = dict()
    for company in companies:
        pre = company[:index]
        num = pre_dict.get(pre, 0)
        num += 1
        pre_dict[pre] = num
    for each in pre_dict:
        if pre_dict[each] >= cut_threshold:
            companies_li.append(each)
    return companies_li












